export default function Postgame() {
    const createCounters = () => {
        const counters = [];
        for (let i = 0; i < 10; i++) {
            counters.push(<span className="miniplane"></span>);
        }
        return counters;
    }

    return (
        <div id="postgame" className="overlay">
            <div className="overlay-content animate__animated animate__faster">
                <div className="overlay-container">
                    <h1>Completion Time</h1>
                    <span id="completion-time"></span>
                </div>
                <div className="overlay-container">
                    <h1>Answers</h1>
                    <div id="answer-times" className="miniplane-container">
                        { createCounters }
                    </div>
                </div>
                <div className='footer'>
                    <div id="countdown">
                        <h1>Next Planes</h1>
                        <span></span>
                    </div>
                    <div id='share'>
                        <button className='answer-button' onClick={createShareable()}>
                            Share
                            <span className="icon">
                                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="#fff" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><circle cx="18" cy="5" r="3"></circle><circle cx="6" cy="12" r="3"></circle><circle cx="18" cy="19" r="3"></circle><line x1="8.59" y1="13.51" x2="15.42" y2="17.49"></line><line x1="15.41" y1="6.51" x2="8.59" y2="10.49"></line></svg>
                            </span>
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
}
